 In C, you can terminate a program using the `exit()` function from the `stdlib.h` library. The `exit()` function takes an integer argument that is returned to the operating system. If the argument is 0, it indicates that the program has executed successfully. If the argument is a non-zero value, it indicates an error has occurred.

Here is an example:

```c
#include <stdio.h>
#include <stdlib.h>

int main() {
    printf("This is a test program.\n");
    exit(0);
}
```

In this example, the program will print "This is a test program." and then terminate successfully. If the `exit(1);` line was used instead, the program would terminate with an error.
